import axios from "axios"

const API_KEY = "f03f1a37cea4a9dc5f835dca86c4e8fb"
const URL = "https://api.openweathermap.org/data/2.5/weather"


export const fetch = async (query) => {
    let { data } = await axios.get(URL, {
        params: {
            q: "query",
            units: "metric",
            APPID: "API_KEY"

        }
    })
    return data

}
